groups.interpolation:
float element_interpolation(in vec3 ref_pos, in float values[20]){ 
    float result = 0.;
    const float u1 = 1. - ref_pos.x - ref_pos.y - ref_pos.z;                                 
    const float v1 = ref_pos.x;                                                              
    const float w1 = ref_pos.y;                                                              
    const float z1 = ref_pos.z;                                                              
    const float u2 = u1*u1;
    const float u3 = u1*u1*u1;
    const float v2 = v1*v1;
    const float v3 = v1*v1*v1;
    const float w2 = w1*w1;
    const float w3 = w1*w1*w1;
    const float z2 = z1*z1;
    const float z3 = z1*z1*z1;
    float r = 0.; 
    r = 0. + 1*u1*z2 + -3*u2*z1 + 1*u3 + 3*u1*v1*z1 + -3*u2*v1 + 1*u1*v2 + 3*u1*w1*z1 + -3*u2*w1 + 3*u1*v1*w1 + 1*u1*w2;
    result += r * values[0];
    r = 0. + 1*v1*z2 + 3*u1*v1*z1 + 1*u2*v1 + -3*v2*z1 + -3*u1*v2 + 1*v3 + 3*v1*w1*z1 + 3*u1*v1*w1 + -3*v2*w1 + 1*v1*w2;
    result += r * values[1];
    r = 0. + 1*w1*z2 + 3*u1*w1*z1 + 1*u2*w1 + 3*v1*w1*z1 + 3*u1*v1*w1 + 1*v2*w1 + -3*w2*z1 + -3*u1*w2 + -3*v1*w2 + 1*w3;
    result += r * values[2];
    r = 0. + 1*z3 + -3*u1*z2 + 1*u2*z1 + -3*v1*z2 + 3*u1*v1*z1 + 1*v2*z1 + -3*w1*z2 + 3*u1*w1*z1 + 3*v1*w1*z1 + 1*w2*z1;
    result += r * values[3];
    r = 0. + -5*u1*v1*z1 + 8.09017*u2*v1 + -3.09017*u1*v2 + -5*u1*v1*w1;
    result += r * values[4];
    r = 0. + -5*u1*v1*z1 + -3.09017*u2*v1 + 8.09017*u1*v2 + -5*u1*v1*w1;
    result += r * values[5];
    r = 0. + -5*u1*w1*z1 + 8.09017*u2*w1 + -5*u1*v1*w1 + -3.09017*u1*w2;
    result += r * values[6];
    r = 0. + -5*u1*w1*z1 + -3.09017*u2*w1 + -5*u1*v1*w1 + 8.09017*u1*w2;
    result += r * values[7];
    r = 0. + -3.09017*u1*z2 + 8.09017*u2*z1 + -5*u1*v1*z1 + -5*u1*w1*z1;
    result += r * values[8];
    r = 0. + 8.09017*u1*z2 + -3.09017*u2*z1 + -5*u1*v1*z1 + -5*u1*w1*z1;
    result += r * values[9];
    r = 0. + -5*v1*w1*z1 + -5*u1*v1*w1 + 8.09017*v2*w1 + -3.09017*v1*w2;
    result += r * values[10];
    r = 0. + -5*v1*w1*z1 + -5*u1*v1*w1 + -3.09017*v2*w1 + 8.09017*v1*w2;
    result += r * values[11];
    r = 0. + -3.09017*v1*z2 + -5*u1*v1*z1 + 8.09017*v2*z1 + -5*v1*w1*z1;
    result += r * values[12];
    r = 0. + 8.09017*v1*z2 + -5*u1*v1*z1 + -3.09017*v2*z1 + -5*v1*w1*z1;
    result += r * values[13];
    r = 0. + -3.09017*w1*z2 + -5*u1*w1*z1 + -5*v1*w1*z1 + 8.09017*w2*z1;
    result += r * values[14];
    r = 0. + 8.09017*w1*z2 + -5*u1*w1*z1 + -5*v1*w1*z1 + -3.09017*w2*z1;
    result += r * values[15];
    r = 0. + 27*v1*w1*z1;
    result += r * values[16];
    r = 0. + 27*u1*w1*z1;
    result += r * values[17];
    r = 0. + 27*u1*v1*z1;
    result += r * values[18];
    r = 0. + 27*u1*v1*w1;
    result += r * values[19];
    return result;
}

groups.mapping:
vec3 element_mapping(in vec3 ref_pos, in vec3 values[4]){ 
    vec3 result = vec3(0.,0.,0.);
    const float u1 = 1. - ref_pos.x - ref_pos.y - ref_pos.z;                                 
    const float v1 = ref_pos.x;                                                              
    const float w1 = ref_pos.y;                                                              
    const float z1 = ref_pos.z;                                                              
    float r = 0.; 
    r = 0. + 1*u1;
    result += r * values[0];
    r = 0. + 1*v1;
    result += r * values[1];
    r = 0. + 1*w1;
    result += r * values[2];
    r = 0. + 1*z1;
    result += r * values[3];
    return result;
}
